import React from "react";

const Hello = () => {

    return(
        <div>
             <div className="display-3">Welcome to the Clicky-Game!</div>
            <div className="display-6">
                This game has 16 images. Your game is to click on one image at a time.
                Each time you click on a new image, you will gain one point. 
                If you click on an image you already clicked on, you will lose. 
                The goal is to click on all 16 images only once! Good Luck!
            </div>
       
        </div>
    );
};
   
export default Hello;
